import { LogoImg } from "../locales/images/logo";
import { HeaderBox, LoginBox, LogoBox, TitleTxt } from "../style";
import { LoginButton } from "../styles/Buttons";
import { MainTitleText, IrishText } from "../styles/TextStyles";
import { Search } from "./SearchBox";

export const Header = ({ filter, setFilter }: any) => {
  return (
    <HeaderBox>
      <Search filter={filter} setFilter={setFilter}></Search>
      <LogoBox>
        <LogoImg />
      </LogoBox>
      <TitleTxt>
        <MainTitleText>Food'n'go!</MainTitleText>
      </TitleTxt>
      <LoginBox>
        <LoginButton>Login</LoginButton>
        <LoginButton>Szczegóły zamówienia</LoginButton>
      </LoginBox>
    </HeaderBox>
  );
};
